import "./style/personal.css"

function TravelCard()  {
    return (
        <div className="personal-card">
    <h3>Quick Facts</h3>
    <h3>Long suffering Arsenal fan</h3>
    <h3>Lived in three countries</h3>
    <h3>Have visited over 25 countries, want to visit South Korea next</h3>
    </div>
    )
    }
    
    export default TravelCard;
